			shellScript = "# Type a script or drag a script file from your workspace to insert its path.\n######################\n# BUILD UNIVERSAL FRAMEWORK\n######################\n\n# Builds and packages the SDK framework fat binary for device and sim.\n# Output Path:  ./Products/\n# @TODO makes this a script in Scripts/ to run manually (and redirect logging IF not done from xcode. See Scripts/build_dep_frameworks)\n\n\n################################\n# CHECKS\n################################\n\n# Logging\n#exec > /tmp/${PROJECT_NAME}_archive.log 2>&1\n\nset -e\n# If we're already inside this script then die\nif [ -n \"$MULTIPLATFORM_BUILD_IN_PROGRESS\" ]; then\n  exit 0\nfi\nexport MULTIPLATFORM_BUILD_IN_PROGRESS=1\n\nif [ ! -d \"MySDK.xcworkspace\" ]; then\n  echo \"Must execute from the root path of the Xcode workspace!\"\n  exit 1\nfi\n\n\n\n\n\n################################\n# CONFIG\n################################\nCONFIGURATION=Release\nWORKSPACE_ROOT=`pwd`\nFRAMEWORK_OUTPUT_DIR=`pwd`\"/Products/${PROJECT_NAME}.xcframework\"\n\n\nlogbig() {\n echo \"\n#######################################\n# ${1}\n#######################################\" #| tee -a $LOG_FILE\n}\n\n\nlogbig \"Making SDK XCFramework\"\necho \"BUILD_DIR=$BUILD_DIR\"\n\n######################\n# BUILD: For sim and device\n######################\n\n\nlogbig \"CLEAN...\"\nxcodebuild clean \\\n    -workspace \"${WORKSPACE_ROOT}/${PROJECT_NAME}.xcworkspace\" \\\n    -scheme \"${PROJECT_NAME}\"\n\n\ndo_build() {\n  local DEST=$1\n\n  xcodebuild build \\\n  -workspace \"${WORKSPACE_ROOT}/${PROJECT_NAME}.xcworkspace\" \\\n  -scheme ${PROJECT_NAME} \\\n  -destination \"$DEST\" \\\n  -configuration ${CONFIGURATION} \\\n  SKIP_INSTALL=NO \\\n  BUILD_LIBRARY_FOR_DISTRIBUTION=YES\n\n}\n\n\nlogbig \"BUILD (Simulator)...\"\ndo_build \"platform=iOS Simulator,name=iPhone 12\"\n\nlogbig \"BUILD (Device)...\"\ndo_build \"generic/platform=iOS\"\n\nlogbig \"MAKE XCFRAMEWORK...\"\n\n# Erase old version. Only do this once the builds are ok\nrm -fr \"${FRAMEWORK_OUTPUT_DIR}\"\nmkdir -p \"${FRAMEWORK_OUTPUT_DIR}\"\n\n# Create it from the two artifacts\nxcodebuild -create-xcframework \\\n    -framework \"${BUILD_DIR}/${CONFIGURATION}-iphoneos/${PROJECT_NAME}.framework\" \\\n    -framework \"${BUILD_DIR}/${CONFIGURATION}-iphonesimulator/${PROJECT_NAME}.framework\" \\\n    -output ${FRAMEWORK_OUTPUT_DIR}\n\nopen \"${FRAMEWORK_OUTPUT_DIR}/..\"\n";
